import { HeartOutlined } from "@ant-design/icons";
import { Card, Rate, Row } from "antd";
import TextArea from "antd/lib/input/TextArea";
import Dragger from "antd/lib/upload/Dragger";


const Comment = () => {
    return(
        <div>
            <Card
              style={{
                width: 300,
                marginLeft: 720, height: 0
              }}
              
            >
                <Row><h2>Comment</h2></Row>
                <Row><h2>My rate is...</h2></Row>
               <Row><Rate character={<HeartOutlined />} value={3} /></Row>  
              <br />
              <Row><h2>My commnet is...</h2></Row>
              <br />
              <Row> <TextArea
                    showCount
                    
                    maxLength={250}
                    style={{
                        height: 110,
                        resize: 'none',
                        
                    }}
                    />
                </Row>
                <br />
                <Row><h2>I recommend this!</h2></Row>
                <Row>
                <span style={{ display: 'inline-block'}}>
        <Dragger  listType="picture" style={{borderRadius: 0, width: '50%'}} {...draggerProps}>
        <p className="ant-upload-drag-icon">
          <Icon type="inbox" />
        </p>
        <p className="ant-upload-text">Click or drag file to this area to upload</p>
        <p className="ant-upload-hint">
          Support for a single or bulk upload. Strictly prohibit from uploading company data or other
          band files
        </p>
      </Dragger>
      </span>
      <span>
      <Button
          type="link"
          data-testid="new-project-button"
          size="large"
          style={{ width: 100 }}
          onClick={() => props.handleBack() }
        >
          Back
        </Button>
        <Button
          type="primary"
          data-testid="new-project-button"
          size="large"
          style={{ width: 100, marginBottom: 50 }}
          onClick={() => props.handleUpdateAndNext(props.updateProjectDetails)}
        >
          Next
        </Button>
      </span>
                </Row>
            </Card>
            
        </div>
    );
};

export default Comment;
